  return (
    <div> 
      <div className='image-container'>
        <img src="" alt="my-pic" />
      </div>
      <div className='paragraph-container'>
        <h1>Hello <span>I'm</span></h1>
        <h1>Zhang Yu-Cheng</h1>
        <span>a former accountant, and now a front end developer</span>
        <p>I graduated from National Chung Cheng University in Taiwan and majored in Finance. My first job started at PricewaterhouseCoopers / 普华永道中天会计师事务所（特殊普通合伙）in Shanghai as an auditor. In my first year of working at PwC, I found bussine management is not what I want do. So I decided to make a career change.
        </p>
      </div>
      <div className='social-media'>
        <a href=""><img src="./img/facebook.svg" alt="" />facebook</a>
        <img src="portfolio/src/img/facebook.svg" alt="" />
      </div>

    </div>
  );
}

export default Home;
